INSERT INTO `ticket` (`idTicket`, `numeroTicket`, `seriePedido`, `folioPedido`, `serieFactura`, `folioFactura`, `titulo`, `contenido`, `prioridad`, `cerrado`, `idAutor`, `idDepartamento`, `departamentoAsignado`, `usuarioAsignado`, `fecha`, `comentarios`, `estatus`) VALUES
(1, 1, '', 0, '', 0, 'Enviar PDF Y XML', 'CLIENTE RAFAEL HILARION BARTOLO HERNANDEZ SOLICITA ENVIAR ARCHIVOS ELECTONICOS FACTURAS FAPB 3235 / 3236 / 3237', 1, 1, 33, 6, 9, 47, '2019-09-18 14:07:13', 2, 0),
(2, 2, '', 0, '', 0, 'Devolución', 'Ing. Serrano, buenas tardes, \r\n\r\nLa cliente Karina Espinoza solicita de manera urgente la Nota de devolución ligada a la factura FACD 6412, comenta que se descontó 2 galones de pasta, le urge esa nota para su contabilidad.\r\n\r\nLa entrega del material de esa factura fue el día 31/07/2019\r\n\r\nGracias', 1, 1, 33, 6, 2, 11, '2019-09-26 18:35:00', 3, 0),
(3, 3, '', 0, '', 0, 'Cancelación', 'Buenas tardes Roberto.\r\nMe podrías apoyar cancelando la factura FAPB 3844, ya que los descuentos están mal.\r\nMi prioridad es alta ya que es el ultimo días del mes.\r\nQuedo al pendiente de cualquier duda o comentario.', 1, 1, 24, 12, 2, 12, '2019-09-30 15:51:39', 2, 0),
(4, 4, '', 0, '', 0, 'otro', 'CLIENTE INDICA TIENE 6 LITROS ECONO PLASTER PIROXILINA GRIS 311100.41\r\nLOTE TC1559AH1, ES DEL LOTE QUE PLANTA SI RECONOCE DEFECTO DE CALIDAD', 1, 1, 15, 7, 11, 21, '2019-10-09 22:00:49', 16, 0),
(5, 5, '', 0, '', 0, 'Cancelación', 'CANCELACIÓN DEL CLIENTE ACATA CENTENO JUAN CARLOS\r\nEL FORMATO SE MANDÓ VÍA CORREO ELECTRÓNICO', 1, 1, 18, 2, 12, 24, '2019-10-10 20:18:06', 4, 0),
(6, 6, '', 0, '', 0, 'Devolución', 'Se entregan 8 piezas en físico de ECONO-PLASTER PIROXILINA GRIS 311100.41 mismos que fueron entregados por el cliente por defecto de calidad.', 2, 1, 46, 10, 12, 24, '2019-10-12 15:29:50', 4, 0),
(7, 7, '', 0, '', 0, 'otro', 'AL CLIENTE LE ENTREGARON 1 GALON DE FX BASE COLOR BLANCO EN LUGAR DE 1 GALON DE FLEXBASE PLUS COLOR BLANCO (QUE ES EL QUE REALMENTE VIENE FACTURADO)\r\nFAVOR DE DARME PRONTA RESPUESTA YA QUE AL CLIENTE LE URGE SU MATERIAL', 1, 1, 15, 7, 12, 24, '2019-10-12 17:17:21', 3, 0),
(8, 8, '', 0, '', 0, 'Devolución', 'Buen día, se genera ticket por devolución del cliente Vergara Florez Zenen debido a que solicito un material, queda el material en resguardo de Logistica esperando indicaciones. Lista de material: 1 cubeta de XCLO PREMIER UNIVERSAL BLANCO 307107.61 Y 3 galones de FX PREMIER UNIVERSAL BLANCO 307118.51', 1, 1, 46, 10, 2, 18, '2019-10-12 18:08:12', 2, 0),
(9, 9, '', 0, '', 0, 'Cancelación', 'Se solicita la cancelación de la siguiente factura\r\nFAPB 3976 del cliente Vergara Flores Zenen\r\n\r\nFormato se anexa en correo', 2, 1, 18, 2, 12, 24, '2019-10-14 14:48:38', 4, 0),
